        private readonly ILogger _logger;

        public HttpTrigger(ILoggerFactory loggerFactory)
        {
            _logger = loggerFactory.CreateLogger<HttpTrigger>();
        }

        [Function("Speakers")]
        public HttpResponseData Run([HttpTrigger(AuthorizationLevel.Anonymous, "get")] HttpRequestData req)
        {
            var split = data.Split(new string[] { "<li" }, StringSplitOptions.None).ToList();
            split.RemoveAt(0);


            List<Speaker> result = new List<Speaker>();

            foreach (var item in split)
            {
                var name = item.Split(new string[] { "speaker__name" }, StringSplitOptions.None)[1]
                    .Split(new string[] { "'speaker'" }, StringSplitOptions.None)[1]
                    .Split(new string[] { ">" }, StringSplitOptions.None)[1]
                .Split(new string[] { "<" }, StringSplitOptions.None)[0].Trim();

                var tag = item.Split(new string[] { "sz-speaker__tagline" }, StringSplitOptions.None)[1]
                    .Split(new string[] { ">" }, StringSplitOptions.None)[1]
                .Split(new string[] { "<" }, StringSplitOptions.None)[0];

                var image = item.Split(new string[] { "sz-speaker__photo" }, StringSplitOptions.None)[1]
                    .Split(new string[] { "src=\"" }, StringSplitOptions.None)[1]
                .Split(new string[] { "\"" }, StringSplitOptions.None)[0];

                var speaker = new Speaker()
                {
                    Name = name,
                    Tag = tag,
                    Image = image
                };

                result.Add(speaker);
            }

            var response = req.CreateResponse(HttpStatusCode.OK);
            response.WriteAsJsonAsync(result);

            return response;
        }
    }
